// src/pages/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/main.css';
import '../styles/Dashboard.css';

function Dashboard() {
  return (
    <div className="dashboard-container container">
      <h1 className="section-heading">GROW IMPRESS</h1>
      <p>Your personal growth journey starts here. Learn, grow, and impress.</p>

      <div className="sections">
        <Link to="/how-to-section" className="standard-box section">
          <img src="Gemini_Generated_Image_f61ha1f61ha1f61h.jpg" alt="How To Section" />
          <p>HOW TO SECTION</p>
        </Link>

        <Link to="/stories" className="standard-box section">
          <img src="Gemini_Generated_Image_6opy9e6opy9e6opy.jpg" alt="Stories of Inspiration" />
          <p>STORIES OF INSPIRATION</p>
        </Link>

        <Link to="/resources" className="standard-box section">
          <img src="Gemini_Generated_Image_ghgrbkghgrbkghgr.jpeg" alt="Resources" />
          <p>RESOURCES</p>
        </Link>

        <Link to="/chatbot" className="standard-box section">
          <img src="Gemini_Generated_Image_kxn534kxn534kxn5.jpeg" alt="Chatbot" />
          <p>CHAT WITH US</p>
        </Link>
      </div>
    </div>
  );
}

export default Dashboard;
